★商品説明★<br>
Clarks「クラークス」から人気定番アイテム、デザートブーツが新入荷！ソール部分は天然クレープソールで、かなり柔らかく、それでいて磨り減り難い優れものです。また、特有の袋縫いは足を包み込む形状になっているのと、つま先部分に芯が入っていないデザートブーツの特色は非常に柔らかで快適な履き心地を生み出します！今回は円高還元もあり、日本定価を大幅に下回るスペシャルプライスにてご提供。<br>
